xwikidoc.content:
/* Groovy Class #* */

import net.sourceforge.plantuml.*

class PlantUMLMacroGClass {

  def umldoc;
  def ctx;
  def umltext;

  void setObjects( doc, context, text) {
    umldoc = doc
    ctx = context
    umltext = text
  }

  String run( request, response) {
    // Using umlref, each diagram of the wiki page has its own unique url
    def umlref="1"
    if (null != ctx.umlref) {
      umlref=Integer.toString(Integer.valueOf(ctx.umlref)+1)
    }
    ctx.put("umlref", umlref)
    if ("plain".equals(request.xpage) && umlref.equals(request.uml)) {
      response.setContentType("image/png")
      def reader = new SourceStringReader("@startuml\n"+umltext+"\n@enduml")
      def png = response.getOutputStream()
      def desc = reader.generateImage(png)
      return
    } else {
      return "[[image:"+umldoc.getExternalURL("get")+"?xpage=plain&uml="+umlref+"||style=\"max-width:100%\"]]"
    }
  }
}

/* *# */
